import React, {useState} from 'react';

//Packages
import {Link} from 'react-router-dom';
import {SiAccusoft as NavLogo} from 'react-icons/si';
import {CgMenuMotion as MenuIcon} from 'react-icons/cg';
import {BsX as XIcon} from 'react-icons/bs';

//Components
import Button from './../button/Button';

//CSS
import './Nav.css';

function Nav() {
    const [navClick, setNavClick] = useState(false);
    const [button, setButton] = useState(true);

    const onHandleClick = () => setNavClick(!navClick);

    const closeMobileMenu = () => setNavClick(false);

    const showButton = () => {
        if (window.innerWidth <= 960) {
            setButton(false)
        } else {
            setButton(true);
        }
    };

    window.addEventListener('resize', showButton)

    return (
        <>
            <div className="nav__top">
                We've got what you're looking for
            </div>

            <nav className={'solid bl bw1'}>
                <div className={'container'}>
                    <ul>
                        <Link>
                            <li className={'nav__logo'}>Brand</li>
                        </Link>
                    </ul>

                    <ul>

                        <Link>
                            <li className={'search'}>
                                <input placeholder={'SEARCH...'}/>
                            </li>
                        </Link>

                        <Link to={'/signin'}>
                            <li className={'login'}>Login</li>
                        </Link>

                        <Link to={'/signin'}>
                            <li className={'login'}>Cart</li>
                        </Link>

                    </ul>
                </div>

            </nav>
        </>
    )
}

export default Nav;
